@NVMHP @LauraRosenvinge @alternativet_ @Spolitik Selvfølgelig kan Å lide Ringbanen. Vi vil have mere S-tog. Det vil S ikke prioritere
Ingen tvivl om at pengepolitik er nationalt. Kommunerne skal presse på for at DK får en god pengepolitik.
Og boliger skal i første omgang bygges på Kløverparken og i samarbejde med nabokommuner
